import React from 'react'

function ExpenseDate(props) {
  return (
    <div>
        <div>{props.date.toLocaleString("en-GB", year)}</div>
        <div>{props.date.toLocaleString("en-GB", month)}</div>
        <div>{props.date.toLocaleString("en-GB", day)}</div>
      </div>
  )
}
export default ExpenseDate
